import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 6.2-951 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/6.2-951.md","filePath":"vacode/6.2-951.md"}'),i={name:"vacode/6.2-951.md"},n=o('<h1 id="§-6-2-951-definitions" tabindex="-1">§ 6.2-951 Definitions. <a class="header-anchor" href="#§-6-2-951-definitions" aria-label="Permalink to &quot;§ 6.2-951 Definitions.&quot;">​</a></h1><p>As used in this article:</p><p>&quot;Benefits consortium&quot; means a trust that complies with the conditions set forth in § <a href="http://law.lis.virginia.gov/vacode/6.2-952/" target="_blank" rel="noreferrer">6.2-952</a>.</p><p>&quot;ERISA&quot; means the federal Employee Retirement Income Security Act of 1974 (P.L. 93-406, 88 Stat. 829), as amended.</p><p>&quot;Sponsoring association&quot; means an association (i) the members of which are banks and employers that provide products and services to banks, (ii) that is incorporated under the Virginia Nonstock Corporation Act (§ <a href="http://law.lis.virginia.gov/vacode/13.1-801/" target="_blank" rel="noreferrer">13.1-801</a> et seq.), (iii) that operates as a nonprofit entity under § 501(c)(6) of the Internal Revenue Code of 1986, (iv) that has been in existence for at least 20 years, and (v) that exists for purposes other than arranging for or providing health and welfare benefits to members. &quot;Sponsoring association&quot; includes any wholly owned subsidiary of a sponsoring association.</p><p>2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0220" target="_blank" rel="noreferrer">220</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0296" target="_blank" rel="noreferrer">296</a>.</p>',6),r=[n];function s(c,l,d,p,h,f){return t(),a("div",null,r)}const g=e(i,[["render",s]]);export{u as __pageData,g as default};
